// src/components/IncomeList.js
import React from 'react';

const IncomeList = ({ incomes }) => {
  return (
    <div>
      <h2>Income List</h2>
      {incomes.length > 0 ? (
        <ul>
          {incomes.map((income) => (
            <li key={income.id}>
              {income.description} - ${income.amount.toFixed(2)}
            </li>
          ))}
        </ul>
      ) : (
        <p>No income records available.</p>
      )}
    </div>
  );
};

export default IncomeList;
